import React, { FC, useState } from "react";
import { Box } from '@chakra-ui/react';

interface MainProps{
    account: string;
}

const Main: FC<MainProps> = ({account}) => {
    const [newImage, setNewImage] = useState<string>();

    return (<>
        <Box>
        {newImage ? (
        <div>NFT</div>
        ) : (
        <Text>LET'S MINT NFT!!</Text>
        )}
        </Box>
    </>
    );
 };
export default Main;
